import {registrationApi} from '../api/registration';
const registrationForm = (email, password, displayName, setSubmitMsg) => {
    if(!email || !password){
        return false;
    }
    const formData = {
        email,
        password,
        displayName
    }
    const responseState = registrationApi(formData, setSubmitMsg);
    return responseState;

}
export {registrationForm};
